$(function(){var r=$("#report-container").get(0);powerbi.bootstrap(r,{type:"report"});var o={type:"report",tokenType:window["powerbi-client"].models.TokenType.Embed};$.ajax({type:"GET",url:$("body").attr("data-base-url")+"/getembedinfo",dataType:"json",success:function(e){embedData=$.parseJSON(JSON.stringify(e)),o.accessToken=embedData.accessToken,o.embedUrl=embedData.reportConfig[0].embedUrl,tokenExpiry=embedData.tokenExpiry;e=powerbi.embed(r,o);e.on("loaded",function(){console.log("Report load successful")}),e.on("rendered",function(){console.log("Report render successful")}),e.off("error"),e.on("error",function(e){e=e.detail;console.error(e)})},error:function(e){var r=$(".error-container");$(".embed-container").hide(),r.show();e=(e="<strong> Error Details: </strong> <br/>"+$.parseJSON(e.responseText).errorMsg).split("\n").join("<br/>");r.html(e)}})});